import logo from './brain.svg';
import './App.css';
import SideBarComponent from './SideBarComponent.js';
import axios from 'axios';
import { useEffect, useState } from 'react';

function App() {

  const [response, setResponse] = useState([])

  useEffect(()=> {
    axios.post('http://127.0.0.1:5000/cohorts',{ 
      "name" : "Proj ENIGMA3 Cortical GWAS",
      "endpoint_id" : "https://enigma-endpoint.disk.isi.edu/enigma_dev/sparql"
  })
    .then((res)=> {
      // console.log(res.data)
        setResponse(res.data);
      });
  });
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        {
          //response.alias? response.alias.map(( aliasval )=><SideBarComponent cohortResult={aliasval}/>):null


          response.length>0 ? response.map((result_cohorts) => (<SideBarComponent cohortResult={result_cohorts}/>)) : null


           //<SideBarComponent cohortResult={response}/>
        }
      </header>
    </div>
  );
}

export default App;
